        <div className="flex justify-center items-center bg-green-300 w-96 h-96 m-5">
                <div className="flex justify-center items-center bg-red-500 w-24 h-24">Div1</div>
                <div className="flex justify-center items-center bg-purple-400 w-24 h-24">Div2</div>
                <div
          className={`absolute transform transition-transform duration-500 ease-in-out ${
            position === 0 ? 'translate-x-0' : 'translate-x-44'
          } w-20 h-20 bg-blue-500 rounded shadow-lg`}
        />
        </div>
    );
}
